// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/Base64.sol";

contract ZodiacNFT is ERC721, AccessControl {
    using Counters for Counters.Counter;
    using Strings for uint256;

    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    Counters.Counter private _tokenIdCounter;

    mapping(uint256 => uint256) public tokenZodiac;

    string[12] private zodiacNames = [
        "Rat", "Ox", "Tiger", "Rabbit", "Dragon", "Snake",
        "Horse", "Goat", "Monkey", "Rooster", "Dog", "Pig"
    ];

    string[12] private zodiacImages = [
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.04.32%20-%20Pixel%20art%20of%20a%20rat%2C%20representing%20the%20Chinese%20zodiac.%20The%20rat%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20for%20an%20N.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.04.36%20-%20Pixel%20art%20of%20an%20ox%2C%20representing%20the%20Chinese%20zodiac.%20The%20ox%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20for%20an%20NF.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.04.38%20-%20Pixel%20art%20of%20a%20tiger%2C%20representing%20the%20Chinese%20zodiac.%20The%20tiger%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20for%20.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.07.21%20-%20Pixel%20art%20of%20a%20rabbit%2C%20representing%20the%20Chinese%20zodiac.%20The%20rabbit%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20fo.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.07.28%20-%20Pixel%20art%20of%20a%20dragon%2C%20representing%20the%20Chinese%20zodiac.%20The%20dragon%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20fo.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.08.41%20-%20Pixel%20art%20of%20a%20snake%2C%20representing%20the%20Chinese%20zodiac.%20The%20snake%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20for%20.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.08.45%20-%20Pixel%20art%20of%20a%20horse%2C%20representing%20the%20Chinese%20zodiac.%20The%20horse%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20for%20.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.09.06%20-%20Pixel%20art%20of%20a%20goat%2C%20representing%20the%20Chinese%20zodiac.%20The%20goat%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20for%20an.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.09.44%20-%20Pixel%20art%20of%20a%20monkey%2C%20representing%20the%20Chinese%20zodiac.%20The%20monkey%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20fo.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.09.52%20-%20Pixel%20art%20of%20a%20rooster%2C%20representing%20the%20Chinese%20zodiac.%20The%20rooster%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.10.02%20-%20Pixel%20art%20of%20a%20dog%2C%20representing%20the%20Chinese%20zodiac.%20The%20dog%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20for%20an%20N.webp",
        "https://bafybeihr2vj6qmi5crxwa6rrqnppvnrlg7e7odep7jwxuu43bhbmptdoxq.ipfs.w3s.link/DALL%C2%B7E%202024-10-02%2016.10.13%20-%20Pixel%20art%20of%20a%20pig%2C%20representing%20the%20Chinese%20zodiac.%20The%20pig%20should%20be%20distinct%2C%20vibrant%2C%20and%20simplified%20in%20classic%20pixel%20art%20style%2C%20suitable%20for%20an%20N.webp"
    ];

    string private combinedImage = "https://example.com/combined-image.jpg";

    constructor() ERC721("ZodiacNFT", "ZNFT") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);
    }

    function safeMint(address to, uint256 zodiacIndex) public onlyRole(MINTER_ROLE) returns (uint256) {
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(to, tokenId);
        tokenZodiac[tokenId] = zodiacIndex;
        return tokenId;
    }

    function burn(uint256 tokenId) public {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "Caller is not owner nor approved");
        _burn(tokenId);
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        _requireMinted(tokenId);

        string memory imageURI;
        string memory name;
        if (tokenZodiac[tokenId] == 12) {
            imageURI = combinedImage;
            name = "Chinese Zodiac Collection";
        } else {
            imageURI = zodiacImages[tokenZodiac[tokenId]];
            name = zodiacNames[tokenZodiac[tokenId]];
        }

        string memory json = Base64.encode(
            bytes(
                string(
                    abi.encodePacked(
                        '{"name": "', name, 
                        '", "description": "Chinese Zodiac NFT", "image": "', 
                        imageURI, 
                        '"}'
                    )
                )
            )
        );

        return string(abi.encodePacked("data:application/json;base64,", json));
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId, uint256 batchSize)
        internal
        override
    {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);

        require(from == address(0) || to == address(0), "NFT is not transferable");
    }

    // The following functions are overrides required by Solidity.

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}

contracts/ZodiacTrading.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "./ZodiacNFT.sol";

contract ZodiacTrading is Ownable, Pausable {
    ZodiacNFT public zodiacNFT;
    uint256 public constant MINT_PRICE = 0.1 ether;
    uint256 public constant MAX_SPECIAL_SUPPLY = 10;
    uint256 public specialTokenIdCounter;

    mapping(address => bool) public whitelist;
    mapping(address => uint256[12]) public userZodiacCollection;

    constructor(address _zodiacNFTAddress) {
        zodiacNFT = ZodiacNFT(_zodiacNFTAddress);
    }

    function addToWhitelist(address[] memory users) external onlyOwner {
        for (uint i = 0; i < users.length; i++) {
            whitelist[users[i]] = true;
        }
    }

    function removeFromWhitelist(address[] memory users) external onlyOwner {
        for (uint i = 0; i < users.length; i++) {
            whitelist[users[i]] = false;
        }
    }

    function mint() external payable whenNotPaused {
        require(whitelist[msg.sender], "Not whitelisted");
        require(msg.value >= MINT_PRICE, "Insufficient payment");
        uint256 zodiacIndex = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender))) % 12;
        uint256 tokenId = zodiacNFT.safeMint(msg.sender, zodiacIndex);

        if (userZodiacCollection[msg.sender][zodiacIndex] == 0) {
            userZodiacCollection[msg.sender][zodiacIndex] = tokenId;
        }
    }

    function combineZodiac() external whenNotPaused {
        require(specialTokenIdCounter < MAX_SPECIAL_SUPPLY, "Maximum special NFTs reached");

        for (uint256 i = 0; i < 12; i++) {
            require(userZodiacCollection[msg.sender][i] != 0, "Incomplete zodiac collection");
        }

        for (uint256 i = 0; i < 12; i++) {
            zodiacNFT.burn(userZodiacCollection[msg.sender][i]);
            userZodiacCollection[msg.sender][i] = 0;
        }

        zodiacNFT.safeMint(msg.sender, 12); // 12 represents the special combined NFT
        specialTokenIdCounter++;
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(owner()).transfer(balance);
    }
}

